import React from 'react';
import { YMaps, Map, Placemark } from '@pbe/react-yandex-maps';

const MapView = () => {
    return (
        <div className="map-container">
            <YMaps>
                <Map
                    defaultState={{ center: [55.751244, 37.618423], zoom: 12 }}
                    width="100%"
                    height="100%"
                >
                    <Placemark geometry={[55.796289, 49.108795]} />
                </Map>
            </YMaps>
        </div>
    );
};

export default MapView;
